import React from 'react'

function Rigbutton() {
  return (
    
        <div className='sm:flex justify-center'>
          <div className='absolute bottom-2 inset-x-0 md:right-2'>
            <button className='bg-orange-600 h-10 w-32 rounded-full'></button>
          </div>
        </div>
  )
}

export default  Rigbutton
